    font-size: 24px;
    font-style: normal;
    font-weight: 700;
    line-height: 140%; /* 33.6px */
    padding-top: 16px;
  }

  &__descript {
    grid-column: 1 / -1;
    grid-row: 3 / 4;
    @include picture-description();
  }
}

.link {
  display: grid;
  width: calc(280px - 96px);
  height: 56px;
  padding: 0 40px;
  margin: 48px auto;
  justify-content: center;
  align-items: center;
  flex-shrink: 0;
  border-radius: 40px;
